    return(
        <div className="new-trip-container">
            <div className="new-trip-header">
                <h2 className="header">Where to?</h2>
            </div>
            <div className="new-trip-content-container">
                <div>
                    <div className="destination-title">Where from</div>
                    <input></input>
                </div>
                <div className="destination-title">Where to</div>
                <input></input>

            </div>
        </div>
    )
}

export default NewTrip;
